import React from 'react'
import {Container,Navbar} from 'react-bootstrap'; 


const kandungan = () => {
  return (
    <div className="gradient-bg">
       <Navbar>
      <Container>
        <Navbar.Brand className="fw-bold float-start"> <h1>Skinlyst</h1> </Navbar.Brand>
        <Navbar.Toggle />
      </Container>
    </Navbar>
    </div>
  )
}

export default kandungan
